センサーが人の動きを感知すると約2分間点灯し、人の動きが感知されなくなると自動で消灯します。<br>しっかり照らす直下重視タイプ。40W相当。<br><br>■電源スイッチをONにすると「ウォームアップモード」となり約30秒間点灯し、消灯します。<br>その後、人の動きを感知しなければ「センサーモード」として待機状態(消灯)となります。<br>※電源スイッチは常時ONの状態で使用してください。待機中は消灯していても電力を約0.1W消費しています。<br>■センサー感知範囲で人の動きを感知すると約2分間点灯します。<br>※感知範囲であっても人の動きがないと約2分後に自動消灯します。<br>※周囲の明るい場所では常時消灯しています。(目安として明るさが約35lx以上では点灯しません)<br>※周囲温度が高い環境で人の体温との差が小さくなるとセンサーの反応が鈍くなり点灯しないことがあります。<br>※センサーは人や熱源による温度差を動きとしてとらえますので、感知範囲に熱源があると人がいなくても点灯する場合があります。<br>(例：動物、エアコン、カーテンの近く、光の反射が強い場所、温風ヒーター、窓ガラスの近くなど)<br><br>■光色：電球色<br>■平均演色性評価数：80以上<br>■消費電力：7W<br>■全光束・器具光束：502lm<br>■設計寿命：約40000時間<br><br>【ご使用の前に・・】<br>下記の器具には絶対に使用しないでください。<br>●調光のついた電球器具や回路。<br>※電球が故障したりちらついたりする場合があります。<br>※100％点灯でも使用不可！<br>※調光：電球の明るさを変える機能のこと。<br>●リモコンのついた照明器具や回路。<br>●誘導灯、非常用照明器具。<br>●水銀灯、ナトリウムランプ、メタルハライドランプなどのHIDランプ器具。<br>●風呂場などの湿気の多い場所、水滴などがかかる場所。<br>●屋内専用ですので屋外用器具には取り付けないでください。<br>●このほかの使用器具の種類によって寸法や熱、その他の状況により使用できない場合があります。<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：ドウシシャ<br>シリーズ名：ルミナス<br>サイズ：Φ60×120mm<br>重量：97g<br>口金：E26<br>材質：ポリカ・アルミ<br>生産国：中国<br><br>購入単位：1個<br>配送種別：在庫品</p></td></tr></table><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>JD0543 9N1244 4549549735555 lva40l-hs LVA40L-HS ドウシシャ どうししゃ 株式会社ドウシシャ DOSHISHA doshisha Doshisha LUMINOUS Luminous luminous LuminousLED LUMINOUSLED ルミナス るみなす ルミナスLED LED led LEDライト LED電球 照明器具 照明 電気 ライト 電球 LED電球 人感センサー 人感 センサー 自動点灯 自動消灯 E26 E26口金 口金E26 40W相当 電球色 でんきゅうしょく 電球 でんきゅう</font></td></tr></table><style type="text/css">
